import React from 'react'
import styled from 'styled-components'
import LogoMain from '../../../../assets/img/logo.svg'

const Logo = () => (
  <StyledLogo>
    <img src={LogoMain} alt='' />
  </StyledLogo>
)
export default Logo

const StyledLogo = styled.div`
	display: flex;
	width: 230px;
	height: 78px;
	background: #FFFFFF;
	border-radius: 0px 0px 9px 9px;
	justify-content: center;
	align-items: center;
	cursor: pointer;
	img {
		display: block;

	}
`
